tables.table_schema:
CREATE TABLE election_results (
    election_id INT PRIMARY KEY,
    election_year INT NOT NULL,
    candidate_name VARCHAR(50) NOT NULL,
    votes_received INT NOT NULL
);

CREATE TABLE political_parties (
    party_id INT PRIMARY KEY,
    party_name VARCHAR(50) NOT NULL
);

CREATE TABLE voting_districts (
    district_id INT PRIMARY KEY,
    district_name VARCHAR(50) NOT NULL
);

CREATE TABLE election_districts (
    district_id INT PRIMARY KEY,
    district_name VARCHAR(50),
    state_name VARCHAR(50),
    region_name VARCHAR(50)
);

CREATE TABLE election_candidates (
    candidate_id INT PRIMARY KEY,
    candidate_name VARCHAR(50),
    party_affiliation VARCHAR(50),
    candidate_position VARCHAR(50)
);

CREATE TABLE election_parties (
    party_id INT PRIMARY KEY,
    party_name VARCHAR(50),
    party_logo BLOB,
    party_leader VARCHAR(50)
);
